import React from 'react';
import './ExpenseItem.css';

const ExpensiveItem = () => {

    const renderText = () => {
        return(
            <>
                <div className="expense-item">
                    <p>From Item expensive Componet!</p>
                </div>
            </>
        )
    }

    return (  
        <>
            { renderText() }
        </>
    );
}
 
export default ExpensiveItem;
